import './Andar.css'

function Andar(props){
    if(props.escolhido){
    return(
        <div className='AndarEscolhido'>
            <div className='verde'></div>
            <div className='verde'></div>
            <div className='verde'></div>
        </div>
    )}else{return(
        <div className='Andar' > 
         <div className='verde'></div>
        <div className='verde'></div>
        <div className='verde'></div></div>
        )   
    }
}

export default Andar
